input.query:
SELECT DISTINCT provider FROM insurance_policies
WHERE provider LIKE '%Mutual%' 
LIMIT 10;

SELECT DISTINCT issuer FROM credit_cards 
WHERE issuer LIKE '%First%'
LIMIT 10;

SELECT DISTINCT bank_name FROM bank_accounts
WHERE bank_name LIKE '%Community%'
LIMIT 10;

SELECT DISTINCT company FROM employments
WHERE company LIKE '%and Sons%'
LIMIT 10;

SELECT DISTINCT service FROM internet_accounts
WHERE service LIKE '%Mail%'
LIMIT 10;

SELECT DISTINCT brand FROM vehicles 
WHERE make LIKE '%Ford%' OR make LIKE '%Toyota%' OR make LIKE '%Honda%'
LIMIT 10;

SELECT DISTINCT make FROM vehicles
ORDER BY make
LIMIT 20;
